const ENDPOINT = "http://localhost:4003/db/users"

export default function GetFavs({ jwt  }) {
  console.log('jwt en get favs', jwt)
    return fetch(`${ENDPOINT}`, {
      method: "GET",
      headers: {
        'Content-Type':' application/json',
        "Authorization": `Bearer ${jwt}`
      }})
      .then((res) => {
        if (!res.ok) throw new Error("Response is NOT ok in get favs service ");
        return res.json();
      })
      .then((res) => {
        const  gifs = res;

       console.log('from get fav service',gifs )

        return gifs;
      });
  }
